import React from 'react'
import Header from './Grids/Header'
import './App.css'

function App() {
  return (
    <div className="App">
      <div className='containerGrids'>
        <div className='headerRaw'><Header /></div>
        <div className='interactionRaw'>
          <Menu />
          <Content />
        </div>
      </div>
    </div>
  );
}

export default App;
